import 'bootstrap/dist/css/bootstrap.min.css'
import 'jquery/dist/jquery.min.js'
import 'bootstrap/dist/js/bootstrap.min.js'
function App() {
  let a = localStorage.getItem('login_token')
  return (
    <div className="App">

        {a?<Home />:<Login_signup />}
